import React from 'react'
import {Redirect, useHistory} from "react-router-dom";

const Account = () => {
    let history=useHistory();
    const token=localStorage.getItem("token")
    if(token==null)
    {
        history.push({
            pathname:'/acc'
        })
    }
    else{
        history.push({
            pathname:'/acc'
        })
    }
    return (
        <div className="account">
            <h1>Account</h1>
        </div>
    )
}

export default Account
